PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT DISTINCT ?country ?countryLabel WHERE {
  VALUES ?country {
    wd:Q1032 wd:Q1033 wd:Q1034 wd:Q1035 wd:Q1036 wd:Q1037 wd:Q1038
  }
  {
    wd:Q3542 wdt:P131 * ?country
  } UNION {
    ?country wdt:P385 wd:Q3542
  } UNION {
    ?basin wdt:P4614 wd:Q3542 .
    ?country wdt:P361 ?basin
  } UNION {
    ?country wdt:P361 wd:Q66065
  } UNION {
    ?country wdt:P131 * wd:Q66065
  } UNION {
    ?country wdt:P131 * ?region .
    ?region wdt:P131 * wd:Q66065
  } UNION {
    ?country wdt:P131 * ?region .
    ?region wdt:P131 * ?subregion .
    ?subregion wdt:P131 * wd:Q66065
  }
  .
  ?country rdfs:label ?countryLabel .
  FILTER ( LANG( ?countryLabel ) = 'en' )
}

